import React from "react";
import {Link} from "react-router-dom";

function Navbar(){
    return <nav>
        <h4><Link to='/'>HOME</Link></h4>
        <h4>Notes</h4>
        <h4>Create</h4>

    </nav>

}

export default Navbar;
